var elem=$("#qunit-fixture");QUnit.test("Registration",function(a){a.ok($.fn.editable,"registered as a jQuery plugin")});QUnit.test("Chainability",function(a){a.ok(elem.editable().addClass("testing"),"can be chained");a.ok(elem.hasClass("testing"),"successfully chained")});QUnit.test("ARIA attributes",function(a){elem.editable().editableAriaShim();a.ok(elem.is('[role="button"]'),"added role")});QUnit.test("Enable/disable/destroy",function(a){elem.editable().editable("disable");a.strictEqual(elem.data("disabled.editable"),true);elem.editable("enable");a.ok(elem.data("event.editable"));elem.editable().editable("destroy");a.notOk(elem.data("event.editable"))});